import React from 'react'
import { Typography } from '@mui/material'
import LoginStyle from './LoginStyle'
const Login = () => {
  const handleSubmit = (e) => {
    alert("submit");
}
const handleWrite = (e) => {
    console.log(e);
}
const classes = LoginStyle();
return (
    <div className={classes.Box}>
        <Typography variant='h4' color="#500979">
            Login
        </Typography>
        <input
            className={classes.Input}
            name='UserName'
            placeholder='UserName'
            onChange={handleWrite}
        />
        <input
            className={classes.Input}
            placeholder='Password'
            name='Password'
            onChange={handleWrite}
        />
        <button className={classes.Button} onClick={handleSubmit}>Login</button>
        <Typography variant='h7' color="#500979">New to ChatRoom?</Typography>
        <button className={classes.Button} onClick="location.href='https://google.com'">Register</button>

    </div>
)
}

export default Login
